import React, { createContext, useState } from 'react';

export const MyContext = createContext();

export const Provider = (props) => {
  const [dataAPI, setDataAPI] = useState(['oi']);

  const values = { dataAPI, setDataAPI };

  return (
    <MyContext.Provider data={[values]}>
      { props.children }
    </MyContext.Provider>
  );
}
